(function (all, date1, week, month, year1, date2, year2) {
                var weekKey = {
                    "Sun"  : "週日",
                    "Mon"  : "週一",
                    "Tue"  : "週二",
                    "Wed"  : "週三",
                    "Thu"  : "週四",
